import Header from "../components/Header";
import Footer from "../components/Footer";

const Contact = ({ footerStyle }) => {
  return (
    <>
      <Header />
      <h1
        style={{
          color: "white",
          textAlign: "center",
          marginTop: "2rem",
          fontSize: "44px",
        }}
      >
        Contact Page Under Construction..
      </h1>
      <Footer />
    </>
  );
};

export default Contact;
